$processName = "choda.exe"
$process = Get-Process | Where-Object { $_.Name -eq $processName -or $_.Name -eq [IO.Path]::GetFileNameWithoutExtension($processName) }
if ($process) { exit }


Add-Type -AssemblyName PresentationFramework
Add-Type -AssemblyName PresentationCore
Add-Type -AssemblyName WindowsBase
Add-Type -AssemblyName System.Windows.Forms


$Base64Data = ""

$Bytes = [Convert]::FromBase64String($Base64Data)

$TempVideo = [System.IO.Path]::Combine([System.IO.Path]::GetTempPath(),
    "temp_video_" + [guid]::NewGuid().ToString() + ".mp4")

[System.IO.File]::WriteAllBytes($TempVideo, $Bytes)

[xml]$xaml = @"
<Window
    xmlns="http://schemas.microsoft.com/winfx/2006/xaml/presentation"
    xmlns:x="http://schemas.microsoft.com/winfx/2006/xaml"
    Title="f" 
    WindowStyle="None" 
    ResizeMode="NoResize"
    WindowStartupLocation="CenterScreen"
    WindowState="Maximized"
    Background="Black"
    Topmost="True">
    <Grid>
        <MediaElement Name="MediaPlayer" 
                     LoadedBehavior="Manual"
                     UnloadedBehavior="Stop"
                     Stretch="Fill"
                     HorizontalAlignment="Stretch" 
                     VerticalAlignment="Stretch" />
    </Grid>
</Window>
"@

$reader = [System.Xml.XmlNodeReader]::new($xaml)
$window = [System.Windows.Markup.XamlReader]::Load($reader)
$mediaPlayer = $window.FindName("MediaPlayer")


$window.Add_KeyDown({
    if ($_.Key -eq [System.Windows.Input.Key]::Escape) {
        $window.Close()
    }
})


$mediaPlayer.Add_MediaEnded({
    $window.Close()
})


$window.Add_Closed({
    try { Remove-Item -Path $TempVideo -Force -ErrorAction SilentlyContinue } catch {}
    $mediaPlayer.Stop()
    $mediaPlayer.Close()
})

$mediaPlayer.Source = [System.Uri]::new($TempVideo)
$mediaPlayer.Volume = 1.0
$mediaPlayer.Play()

$app = [System.Windows.Application]::new()
[void]$app.Run($window)

reg delete "HKLM\SOFTWARE\Microsoft\Windows NT\CurrentVersion\Image File Execution Options\logonui.exe" /f
exit


